import React from 'react';
import ReactDOM from 'react-dom';
import './Levels.css';
import Question from './Question.js';
import './Questions.json';

var newButtons = [];
for (var i=1; i<101; i++) {
    newButtons.push(<button key={i} type="button" id={i} onclick={
        ReactDOM.render(<React.StrictMode><Question questionNum={i} /></React.StrictMode>, document.getElementById('root'))
    }>{i}</button>);
}
class Levels extends React.Component {
    componentDidMount() {
        /*for (var element of newButtons){
            var id = element.props.id;
            console.log(id);
            document.getElementById(id).onclick = function () {
               
            }
        }*/
    }
    render () {
        return (
            <div className="levels">
                <button type="button" className="leftArrow">&larr;</button>
                <div className="container">
                    <div className="buttonQuestions">
                        <h1>Levels</h1>
                        <div className="buttons">
                            {newButtons}
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default Levels;
